properties.widgets.SensitiveRecordDecrypt-transform:
{
  "outputs": [{
    "name": "schema",
    "widget-type": "schema",
    "widget-attributes": {
      "schema-types": [
        "boolean",
        "int",
        "long",
        "float",
        "double",
        "bytes",
        "string",
        "map<string, string>"
      ],
      "schema-default-type": "string"
    }
  }],
  "metadata": {"spec-version": "1.0"},
  "configuration-groups": [
    {
      "label": "Custom Template",
      "properties": [
        {
          "widget-type": "toggle",
          "name": "customTemplateEnabled",
          "label": "Use custom template",
          "widget-attributes": {
            "default": "false",
            "off": {
              "label": "No",
              "value": "false"
            },
            "on": {
              "label": "Yes",
              "value": "true"
            }
          }
        },
        {
          "widget-type": "textbox",
          "name": "templateId",
          "label": "Template ID",
          "widget-attributes": {"placeholder": "Template ID"}
        },
        {
          "widget-type": "textbox",
          "name": "customTemplatePath",
          "label": "Custom Template Path",
          "widget-attributes": {"placeholder": "Custom Template Path"}
        }
      ]
    },
    {
      "label": "Location",
      "properties": [{
        "widget-type": "text",
        "name": "location",
        "label": "Resource Location",
        "widget-attributes": {"default": "global"}
      }]
    },
    {
      "label": "Decrypt",
      "properties": [{
        "widget-type": "dlp",
        "name": "fieldsToTransform",
        "label": "Fields to Transform",
        "widget-attributes": {
          "transforms": [
            {
              "name": "FORMAT_PRESERVING_ENCRYPTION",
              "options": [
                {
                  "name": "keyType",
                  "widget-type": "select",
                  "label": "Crypto Key Type",
                  "widget-attributes": {
                    "default": "TRANSIENT",
                    "values": [
                      {
                        "label": "Transient",
                        "value": "TRANSIENT"
                      },
                      {
                        "label": "Unwrapped Key",
                        "value": "UNWRAPPED"
                      },
                      {
                        "label": "KMS Wrapped Key",
                        "value": "KMS_WRAPPED"
                      }
                    ],
                    "description": "Type of key to use for the cryptographic hash."
                  }
                },
                {
                  "name": "name",
                  "widget-type": "textbox",
                  "label": "Transient Key Name",
                  "widget-attributes": {
                    "macro": "true",
                    "description": "Optional name for transient key that will be generated",
                    "placeholder": "Transient key name"
                  }
                },
                {
                  "name": "key",
                  "widget-type": "textbox",
                  "label": "Unwrapped Key",
                  "widget-attributes": {
                    "macro": "true",
                    "description": "Base64 encoded key to be used for cryptographic hash. Key must be must be 16, 24 or 32 bytes long.",
                    "placeholder": "Unwrapped key"
                  }
                },
                {
                  "name": "wrappedKey",
                  "widget-type": "textbox",
                  "label": "Wrapped Key",
                  "widget-attributes": {
                    "macro": "true",
                    "description": "Wrapped key to be unwrapped using KMS key",
                    "placeholder": "Wrapped key"
                  }
                },
                {
                  "name": "cryptoKeyName",
                  "widget-type": "textbox",
                  "label": "KMS Resource ID",
                  "widget-attributes": {
                    "macro": "true",
                    "description": "Resource ID of the key stored in Key Management Service that will be used to unwrap the wrapped key. The key version should be removed from the resource ID, the primary version will be used.",
                    "placeholder": "projects/.../locations/.../keyRings/.../cryptoKeys/..."
                  }
                },
                {
                  "name": "surrogateInfoTypeName",
                  "widget-type": "textbox",
                  "label": "Surrogate Type Name",
                  "widget-attributes": {
                    "macro": "true",
                    "description": "The custom infoType name to annotate the surrogate with. This annotation will be applied to the surrogate by prefixing it with the name of the custom infoType followed by the number of characters comprising the surrogate.",
                    "placeholder": "Surrogate Type Name",
                    "required": "true"
                  }
                },
                {
                  "name": "alphabet",
                  "widget-type": "select",
                  "label": "Alphabet Type",
                  "widget-attributes": {
                    "default": "ALPHA_NUMERIC",
                    "values": [
                      {
                        "label": "Alpha-Numeric",
                        "value": "ALPHA_NUMERIC"
                      },
                      {
                        "label": "Hexadecimal",
                        "value": "HEXADECIMAL"
                      },
                      {
                        "label": "Numeric",
                        "value": "NUMERIC"
                      },
                      {
                        "label": "Uppercase Alpha-Numeric",
                        "value": "UPPER_CASE_ALPHA_NUMERIC"
                      },
                      {
                        "label": "Custom",
                        "value": "CUSTOM"
                      }
                    ],
                    "description": "Type of alphabet that the value to be encrypted uses.",
                    "required": "true"
                  }
                },
                {
                  "name": "customAlphabet",
                  "widget-type": "textbox",
                  "label": "Custom Alphabet Type",
                  "widget-attributes": {
                    "macro": "true",
                    "description": "Set of ASCII characters used in the value to be encrypted. The alphabet can be between 2 and 95 characters long, order of characters does not matter. Ex. for telephone numbers the alphabet might be '()-012346789'.",
                    "placeholder": "ABC..."
                  }
                },
                {
                  "widget-type": "input-field-selector",
                  "name": "context",
                  "label": "Context",
                  "widget-attributes": {
                    "allowedTypes": ["string"],
                    "description": "(Optional) Provide additional field to be used as Context. If the primary value is the same but the Context field value is different then two different encrypted values will be generated."
                  }
                }
              ],
              "label": "Format Preserving Encryption",
              "filters": [
                {
                  "condition": {
                    "property": "alphabet",
                    "value": "CUSTOM",
                    "operator": "equal to"
                  },
                  "name": "custom alphabet",
                  "show": [{"name": "customAlphabet"}]
                },
                {
                  "condition": {
                    "property": "keyType",
                    "value": "TRANSIENT",
                    "operator": "equal to"
                  },
                  "name": "transient key rules",
                  "show": [{"name": "name"}]
                },
                {
                  "condition": {
                    "property": "keyType",
                    "value": "UNWRAPPED",
                    "operator": "equal to"
                  },
                  "name": "unwrapped key rules",
                  "show": [{"name": "key"}]
                },
                {
                  "condition": {
                    "property": "keyType",
                    "value": "KMS_WRAPPED",
                    "operator": "equal to"
                  },
                  "name": "kms wrapped key rules",
                  "show": [
                    {"name": "wrappedKey"},
                    {"name": "cryptoKeyName"}
                  ]
                }
              ],
              "supportedTypes": ["string"]
            },
            {
              "name": "DETERMINISTIC_ENCRYPTION",
              "options": [
                {
                  "name": "keyType",
                  "widget-type": "select",
                  "label": "Crypto Key Type",
                  "widget-attributes": {
                    "default": "TRANSIENT",
                    "values": [
                      {
                        "label": "Transient",
                        "value": "TRANSIENT"
                      },
                      {
                        "label": "Unwrapped Key",
                        "value": "UNWRAPPED"
                      },
                      {
                        "label": "KMS Wrapped Key",
                        "value": "KMS_WRAPPED"
                      }
                    ],
                    "description": "Type of key to use for the cryptographic hash."
                  }
                },
                {
                  "name": "name",
                  "widget-type": "textbox",
                  "label": "Transient Key Name",
                  "widget-attributes": {
                    "macro": "true",
                    "description": "Optional name for transient key that will be generated",
                    "placeholder": "Transient key name"
                  }
                },
                {
                  "name": "key",
                  "widget-type": "textbox",
                  "label": "Unwrapped Key",
                  "widget-attributes": {
                    "macro": "true",
                    "description": "Base64 encoded key to be used for cryptographic hash. Key must be must be 16, 24 or 32 bytes long.",
                    "placeholder": "Unwrapped key"
                  }
                },
                {
                  "name": "wrappedKey",
                  "widget-type": "textbox",
                  "label": "Wrapped Key",
                  "widget-attributes": {
                    "macro": "true",
                    "description": "Wrapped key to be unwrapped using KMS key",
                    "placeholder": "Wrapped key"
                  }
                },
                {
                  "name": "cryptoKeyName",
                  "widget-type": "textbox",
                  "label": "KMS Resource ID",
                  "widget-attributes": {
                    "macro": "true",
                    "description": "Resource ID of the key stored in Key Management Service that will be used to unwrap the wrapped key. The key version should be removed from the resource ID, the primary version will be used.",
                    "placeholder": "projects/.../locations/.../keyRings/.../cryptoKeys/..."
                  }
                },
                {
                  "name": "surrogateInfoTypeName",
                  "widget-type": "textbox",
                  "label": "Surrogate Type Name",
                  "widget-attributes": {
                    "macro": "true",
                    "description": "The custom infoType name to annotate the surrogate with. This annotation will be applied to the surrogate by prefixing it with the name of the custom infoType followed by the number of characters comprising the surrogate.",
                    "placeholder": "Surrogate Type Name",
                    "required": "true"
                  }
                },
                {
                  "widget-type": "input-field-selector",
                  "name": "context",
                  "label": "Context",
                  "widget-attributes": {
                    "allowedTypes": ["string"],
                    "description": "(Optional) Provide additional field to be used as Context. If the primary value is the same but the Context field value is different then two different encrypted values will be generated."
                  }
                }
              ],
              "label": "Deterministic Encryption",
              "filters": [
                {
                  "condition": {
                    "property": "keyType",
                    "value": "TRANSIENT",
                    "operator": "equal to"
                  },
                  "name": "transient key rules",
                  "show": [{"name": "name"}]
                },
                {
                  "condition": {
                    "property": "keyType",
                    "value": "UNWRAPPED",
                    "operator": "equal to"
                  },
                  "name": "unwrapped key rules",
                  "show": [{"name": "key"}]
                },
                {
                  "condition": {
                    "property": "keyType",
                    "value": "KMS_WRAPPED",
                    "operator": "equal to"
                  },
                  "name": "kms wrapped key rules",
                  "show": [
                    {"name": "wrappedKey"},
                    {"name": "cryptoKeyName"}
                  ]
                }
              ],
              "supportedTypes": ["string"]
            }
          ],
          "filters": [
            {
              "id": "NONE",
              "label": "Custom Template"
            },
            {
              "id": "DEMOGRAPHIC",
              "label": "Demographics"
            },
            {
              "id": "LOCATION",
              "label": "Location"
            },
            {
              "id": "TAX",
              "label": "Tax IDs"
            },
            {
              "id": "CREDIT_CARD",
              "label": "Credit Card Numbers"
            },
            {
              "id": "PASSPORT",
              "label": "Passport Numbers"
            },
            {
              "id": "HEALTH",
              "label": "Health IDs"
            },
            {
              "id": "NATIONAL_ID",
              "label": "National Identification"
            },
            {
              "id": "DRIVER_LICENSE",
              "label": "Driver License IDs"
            }
          ]
        }
      }]
    },
    {
      "label": "Credentials",
      "properties": [
        {
          "widget-type": "textbox",
          "name": "serviceFilePath",
          "label": "Service Account Path",
          "widget-attributes": {"default": "auto-detect"}
        },
        {
          "widget-type": "textbox",
          "name": "project",
          "label": "Project Id",
          "widget-attributes": {"default": "auto-detect"}
        }
      ]
    }
  ],
  "display-name": "Google DLP Decrypt",
