properties.widgets.SensitiveRecordRedaction-transfo:
{
  "outputs": [{
    "name": "schema",
    "widget-type": "schema",
    "widget-attributes": {
      "schema-types": [
        "boolean",
        "int",
        "long",
        "float",
        "double",
        "bytes",
        "string",
        "map<string, string>"
      ],
      "schema-default-type": "string"
    }
  }],
  "metadata": {"spec-version": "1.0"},
  "configuration-groups": [
    {
      "label": "Custom Template",
      "properties": [
        {
          "widget-type": "toggle",
          "name": "customTemplateEnabled",
          "label": "Use custom template",
          "widget-attributes": {
            "default": "false",
            "off": {
              "label": "No",
              "value": "false"
            },
            "on": {
              "label": "Yes",
              "value": "true"
            }
          }
        },
        {
          "widget-type": "textbox",
          "name": "templateId",
          "label": "Template ID",
          "widget-attributes": {"placeholder": "Template ID"}
        },
        {
          "widget-type": "textbox",
          "name": "customTemplatePath",
          "label": "Custom Template Path",
          "widget-attributes": {"placeholder": "Custom Template Path"}
        }
      ]
    },
    {
      "label": "Location",
      "properties": [{
        "widget-type": "text",
        "name": "location",
        "label": "Resource Location",
        "widget-attributes": {"default": "global"}
      }]
    },
    {
      "label": "Matching",
      "properties": [{
        "widget-type": "dlp",
        "name": "fieldsToTransform",
        "label": "Fields to Transform",
        "widget-attributes": {
          "transforms": [
            {
              "name": "MASKING",
              "options": [
                {
                  "name": "maskingChar",
                  "widget-type": "textbox",
                  "label": "Masking Character",
                  "widget-attributes": {
                    "placeholder": "Character to be used to mask sensitive data",
                    "required": "true"
                  }
                },
                {
                  "name": "numberToMask",
                  "widget-type": "number",
                  "label": "Number of characters to mask",
                  "widget-attributes": {
                    "default": "0",
                    "min": "0",
                    "description": "Number of characters to mask within the matching text. Leave blank or use 0 to mask all characters"
                  }
                },
                {
                  "widget-type": "toggle",
                  "name": "reverseOrder",
                  "label": "Reverse Order",
                  "widget-attributes": {
                    "default": "false",
                    "description": "Characters will be masked starting from the end of the string if order is reversed",
                    "off": {
                      "label": "False",
                      "value": "false"
                    },
                    "on": {
                      "label": "True",
                      "value": "true"
                    }
                  }
                },
                {
                  "name": "charsToIgnoreEnum",
                  "widget-type": "select",
                  "label": "Characters to skip",
                  "widget-attributes": {
                    "default": "COMMON_CHARS_TO_IGNORE_UNSPECIFIED",
                    "values": [
                      {
                        "label": "None",
                        "value": "COMMON_CHARS_TO_IGNORE_UNSPECIFIED"
                      },
                      {
                        "label": "Numbers (0-9)",
                        "value": "NUMERIC"
                      },
                      {
                        "label": "Alphabet Upper Case (A-Z)",
                        "value": "ALPHA_UPPER_CASE"
                      },
                      {
                        "label": "Alphabet Lower Case (a-z)",
                        "value": "ALPHA_LOWER_CASE"
                      },
                      {
                        "label": "Punctuation (!\"#$%&'()*+,-./:;<=>?@[]^_`{|}~)",
                        "value": "PUNCTUATION"
                      },
                      {
                        "label": "Whitespace",
                        "value": "WHITESPACE"
                      }
                    ],
                    "description": "Characters to be skipped within the matching text"
                  }
                }
              ],
              "label": "Masking",
              "supportedTypes": ["string"]
            },
            {
              "name": "REPLACE_VALUE",
              "options": [{
                "name": "newValue",
                "widget-type": "textbox",
                "label": "Replace Value",
                "widget-attributes": {
                  "description": "Text that will be used to replace data that matches the filter",
                  "placeholder": "New value",
                  "required": "true"
                }
              }],
              "label": "Replace with value",
              "supportedTypes": ["string"]
            },
            {
              "name": "REDACT",
              "options": [],
              "label": "Redact",
              "supportedTypes": ["string"]
            },
            {
              "name": "CRYPTO_HASH",
              "options": [
                {
                  "name": "keyType",
                  "widget-type": "select",
                  "label": "Crypto Key Type",
                  "widget-attributes": {
                    "default": "TRANSIENT",
                    "values": [
                      {
                        "label": "Transient",
                        "value": "TRANSIENT"
                      },
                      {
                        "label": "Unwrapped Key",
                        "value": "UNWRAPPED"
                      },
                      {
                        "label": "KMS Wrapped Key",
                        "value": "KMS_WRAPPED"
                      }
                    ],
                    "description": "Type of key to use for the cryptographic hash."
                  }
                },
                {
                  "name": "name",
                  "widget-type": "textbox",
                  "label": "Transient Key Name",
                  "widget-attributes": {
                    "macro": "true",
                    "description": "Optional name for transient key that will be generated",
                    "placeholder": "Transient key name"
                  }
                },
                {
                  "name": "key",
                  "widget-type": "textbox",
                  "label": "Unwrapped Key",
                  "widget-attributes": {
                    "macro": "true",
                    "description": "Base64 encoded key to be used for cryptographic hash. Key must be must be 16, 24 or 32 bytes long.",
                    "placeholder": "Unwrapped key"
                  }
                },
                {
                  "name": "wrappedKey",
                  "widget-type": "textbox",
                  "label": "Wrapped Key",
                  "widget-attributes": {
                    "macro": "true",
                    "description": "Wrapped key to be unwrapped using KMS key",
                    "placeholder": "Wrapped key"
                  }
                },
                {
                  "name": "cryptoKeyName",
                  "widget-type": "textbox",
                  "label": "KMS Resource ID",
                  "widget-attributes": {
                    "macro": "true",
                    "description": "Resource ID of the key stored in Key Management Service that will be used to unwrap the wrapped key. The key version should be removed from the resource ID, the primary version will be used.",
                    "placeholder": "projects/.../locations/.../keyRings/.../cryptoKeys/..."
                  }
                }
              ],
              "label": "One-way Hash",
              "filters": [
                {
                  "condition": {
                    "property": "keyType",
                    "value": "TRANSIENT",
                    "operator": "equal to"
                  },
                  "name": "transient key rules",
                  "show": [{"name": "name"}]
                },
                {
                  "condition": {
                    "property": "keyType",
                    "value": "UNWRAPPED",
                    "operator": "equal to"
                  },
                  "name": "unwrapped key rules",
                  "show": [{"name": "key"}]
                },
                {
                  "condition": {
                    "property": "keyType",
                    "value": "KMS_WRAPPED",
                    "operator": "equal to"
                  },
                  "name": "kms wrapped key rules",
                  "show": [
                    {"name": "wrappedKey"},
                    {"name": "cryptoKeyName"}
                  ]
                }
              ]
            },
            {
              "name": "DATE_SHIFT",
              "options": [
                {
                  "name": "lowerBoundDays",
