                  "label": "Unwrapped Key",
                  "widget-attributes": {
                    "macro": "true",
                    "description": "Base64 encoded key to be used for cryptographic hash. Key must be must be 16, 24 or 32 bytes long.",
                    "placeholder": "Unwrapped key"
                  }
                },
                {
                  "name": "wrappedKey",
                  "widget-type": "textbox",
